The Family of Man The Family of Man ass eng Fotosausstellung, déi vun 1951 un vum US-amerikanesche Fotograf Edward Steichen, engem gebiertege Lëtzebuerger, zesummegestallt gi war. Der New York Times no symbiliséiert se the universality of human emotions. Si gouf 2003 an d'UNESCO-Gediechtnes vun der Welt opgeholl. De 24. Januar 1955 ass am Museum of Modern Art (MoMA) zu New York eng Fotoaustellung, The Family of Man, opgaang. Aus iwwer 2 Millioune Fotoe waren fir d'éischt emol 10.000 Stéck erausg
..........
chlass, an engem erweiderte Kader, an no hirem urspréngleche Lay-out, installéiert. 2003 gouf Family of Man an d'Memory of the World Register vun der UNESCO opgeholl. E puer vun de Fotografen, vun deenen e Wierk an der Ausstellung hänkt: - Vum Ansel Adams de Mt. Williamson; - Dem Ernst Haas seng Foto vum Albert Einstein; - 2 Fotoen vun der Dorothea Lange an eng vun der Doris Ulman vun der Hongersnout a Kalifornien an den 30er Joren; - Dem William Eugene Smith seng Foto Walk into Paradise Garden;
